import "./aboutMe.css";

export default function AboutMe () {
    return (
        <>
            <link href='https://fonts.googleapis.com/css?family=Calistoga' rel='stylesheet'></link>
            <div class="about-me-background-rectangle"></div>
            <div class="about-the-team-text">about the team</div>
            <div class="our-impact-text">If you’ve ever found investing to be complicated and a little scary, you’re not alone! We made Dr. Stox here to help you learn more about the basics of investing in different securities in an accessible and easy-to-comprehend way. This simulation simplifies what investing looks like to help people understand the basic structure of what the process looks like.</div>
        </>
    );
};
